import React, {Component} from "react";
import axios from "axios";

class Ciudades extends Component{
    state ={
        ciudades: []
    }
    componentDidMount(){
        axios.get('https://raw.githubusercontent.com/diego-alvarado-escobar/proyectoclima/main/ciudadescolombia.json')
        .then((response)=>{
            console.log(response);
            this.setState({ciudades: response})
        })
        .catch((error) => {
            console.log(error);
        })
    }

    render(){
        return (
            <div className="ciudades">
                <div className="form-group">
                    <select name="ciudades" className="form-control">
                        //{this.state.ciudades.map(ciudad=>(
                            <option key={ciudad.id} value={ciudad.id}>{ciudad.name}</option>
                        ))}
                    </select>
                </div>
            </div> 

        );
    }
}

export default Ciudades;
